import React from 'react';
import styles from '../style.module.css';
import image from './Login.jpg'

const Picture = () =>{
    return(<div className={styles.container}>
        <img src={image} alt="Swap Clothes" height={400} width={275}/>
    </div>);
}

export default Picture;
